import React from 'react';
import {Button, Container} from "react-bootstrap";

const Admin = () => {
    return (
        <Container>
            <Button variant={"outline-dark"} className="mt-4">
                Добарити тип
            </Button>
            <Button variant={"outline-dark"} className="mt-4">
                Добавити бренд
            </Button>
            <Button variant={"outline-dark"} className="mt-4">
                Добавити пристрій
            </Button>
        </Container>
    );
};

export default Admin;
